11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"विश्व स्तर पर युग के सबसे महान जादूगरों में से एक के रूप में जाना जाता है। उर्वर प्रतिभा, परोपकार, मिलनसारिता और अंतर्दृष्टि के साथ उपहार में दिया गया। सभी भेषों में से, वह सामान्य रूप से एक खरगोश में बदल गया, और केवल कुछ ने ही जादू के पीछे उसका वास्तविक चेहरा देखा है।"],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"काबिले के प्रसिद्ध कथाकार और संगीतकार. जब वह जमीनों और समुद्रों में घूमता रहा, तो उसे कभी किसी ने नहीं देखा। उनकी गहरी आवाज और बुद्धि के साथ, कई स्तुति गाए गए हैं "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"शुद्ध और पेंग। बाहरी दुनिया के बारे में उत्सुकता से भरी, वह जब भी अभिव्यंजक महसूस करती है, ढोल बजाना पसंद करती है।"],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"सभी शेरों का राजा, और मनुष्य की तरह चलता है। इसने एक बार अपने आदिवासी सदस्यों के साथ अपनी अद्भुत मातृभूमि खो दी, लेकिन अपनी असाधारण ताकत, गवाह और बहादुरी के साथ, एक सच्चा नेता इसे अंत में वापस ले लेगा।"],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
