12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%>वहाँ पर एक नेकदिल व्यक्ति है, कृपया मेरी मदद करें!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>मैं इन <color=#38c0a5>टोटम</color> में फंस गया हूँ!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"<color=#f58c26>मर्ज करने</color> के लिए एक ही तरह के कोई भी 3 <color=#38c0a5>टोटम</color> खींचें, और शाप का असर समाप्त हो जाएगा।"],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%>आह! मुझे यहाँ कोई टोटम दिखाई नहीं दे रहे हैं!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>देखो! वह <color=#f58c26>सृजन का कोड</color> है। आपको यह कई लेवल में दिखाई देगा। आइए देखें इसमें क्या लिखा है।"],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%>गेम के लिए कुछ उपयोगी टिप्स लेने के लिए इस पर टैप करें। इसे आजमायें!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>यदि आप कोई लेवल जीतना चाहते हैं तो आपको एक <color=#f58c26>नामित वस्तु</color> प्राप्त करनी होगी।"],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>"<line-height=130%><color=#f58c26>लेवल का उद्देश्य</color> आपको बताएगा कि आपको क्या प्राप्त करना है। मर्ज करना शुरू करें और जीतें!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>वाह, एक <color=#ef933d>युवा एम्बला की नक्काशी</color>! इनकी शक्तियां भी क्षीण हो गई हैं! हमें नक्काशियों को मर्ज करके <color=#f58c26>एम्बला</color> को जगाना होगा।"],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"अगर किसी लेवल में ये नक्काशियां हैं तो आप आमतौर पर उन्हें मर्ज करके लेवल को जीत सकते हैं।"],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>इन भूमियों ने अपनी देवी से संपर्क खो दिया है, इसलिए ये निष्क्रिय हो गई हैं।"],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%>आप <color=#38aec0>निष्क्रिय भूमियों</color> पर कोई भी वस्तु स्थानांतरित नहीं कर सकते हैं।"],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>भूमि को जागृत करने के लिए कोई भी <color=#38c0a5>स्पिरिट फूल</color> मर्ज करें।"],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>आपके जीत जाने पर, <color=#f58c26>देवी एम्बला</color> सभी भूमियों को जागृत कर देंगी!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>देखो! यह एक <color=#38c0a5>टोटम</color> है।"],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"अंदर फंसे जनजातीय सदस्यों को बचाने के लिए जल्दी से <color=#38c0a5>तीन टोटम</color> मर्ज करें!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"जैसा हमने अभी कहा, आप भूमि को जागृत करने के लिए एक <color=#38c0a5>जंगली रुन ऑर्ब</color> पर टैप कर सकते हैं।"],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%>बेशक, अधिक उन्नत ऑर्ब प्राप्त करने के लिए उन्हें मर्ज भी कर सकते हैं!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"आप निष्क्रिय भूमियों को अपने आप जागृत करने के लिए सामान्य भूमि वाली वस्तुओं को <color=#38aec0>निष्क्रिय भूमि</color> पर मर्ज कर सकते हैं।"],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"एक <color=#38c0a5>टोटम</color> पाने के लिए <color=#38c0a5>टोटम समूह</color> पर टैप करें।"],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"कुछ <color=#38aec0>अत्यधिक निष्क्रिय भूमियों</color> को <color=#f58c26>हीलिंग अंकों</color> के माध्यम से जागृत नहीं किया जा सकता, लेकिन उन्हें केवल उनकी वस्तुओं को सामान्य भूमि की वस्तुओं से मर्ज करके जागृत किया जा सकता है।"],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>अब से, लेवल में <color=#f58c26>कार्य</color> शामिल होंगे।"],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>आप कार्यों और पुरस्कारों के लिए <color=#38c0a5>टास्क सन</color> की जांच कर सकते हैं।"],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>यह बटन <color=#f58c26>स्क्रीन ड्रैगिंग फंक्शन</color> को लॉक या अनलॉक कर सकता है।"],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"कुछ वस्तुओं को सीधे मर्ज किया जा सकता है। <color=#ef933d>वेज आकार की चट्टानों के ढेर</color> को <color=#ef933d>वेज आकार की चट्टानों</color> में तोड़ने के लिए उस पर टैप करें और फिर उन्हें मर्ज करें। "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>आपको <color=#f58c26>लेवल के उद्देश्य</color> देखने चाहिए।"],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>हम <color=#38c0a5>ड्रैगन की हड्डियाँ</color> से </color>बुश स्प्राउट<color=#ef933d> प्राप्त कर सकते हैं।"],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"यह एक विशाल <color=#ef933d>वेक-अप बम</color> है। यदि आप इसके बगल की भूमि को जागृत करते हैं, तो यह अपने आप जाग जाएगी, और इसके आसपास की टाइलों को सीधे जगा देगी।"],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"जनजातीय सदस्य हाई लेवल की <color=#38c0a5>बेलों</color> से आपके लिए <color=#38c0a5>जंगली अयस्क</color> एकत्र कर सकते हैं।"],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"यह एक <color=#ef933d>बिखरा हुआ मकबरा</color> है। यदि आप उनकी उपेक्षा या उन्हें मर्ज करते हैं, तो वे भयानक <color=#df66a8>ज़ोंबी</color> में बदल जाएंगे। <color=#38c0a5>फायरफ्लाइ</color> प्राप्त करने के लिए उन्हें हराएं, जिनकी आवश्यकता आपको लेवल को पास करने लिए होगी।"],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"एक <color=#ef933d>परित्यक्त वॉलनेस्ट</color> निष्क्रिय रहते हुए भी लगातार ज़ोंबी उत्पन्न करता है। इसे टैप करने से तुरंत एक ज़ोंबी बन जाता है! ज़ोंबी को नष्ट करने से आपको <color=#38c0a5>जंगली अयस्क</color> मिलते हैं।"],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"यह एक <color=#38c0a5>ड्र्यूड का रून पोर्टल</color> है, हम कितने भाग्यशाली हैं! आपकी मदद करने के लिए मातृभूमि से एक <color=#38c0a5>जनजातीय सदस्य</color> को बुलाने के लिए उन्हें मर्ज करें।"],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"सृजन के पवित्र वृक्ष का अवशेष। स्वचालित रूप से <color=#38c0a5>जंगली रून ऑर्ब</color>' का उत्पादन करता है। लेवल जितना अधिक होगा, हीलिंग पॉवर उतनी ही मजबूत होगी।"],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" यहां से <color=#ef933d>बादल</color> दिखाई देते रहेंगे। बारिश करने के लिए उन पर टैप करें। उनके नीचे खाली भूमि पर <color=#38c0a5>पोखर</color> और <color=#38c0a5>स्पिरिट फूल</color> दिखाई देंगे।"],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>अजीब बात है....<color=#ef933d>युवा एम्बला की नक्काशी</color> कहाँ है?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>ओह, हाँ, अगर आप अपने <color=#f58c26>कार्य</color> पूरे करते हैं तो वे दिखाई दे जाएंगे!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"यह एक <color=#ef933d>दानव की मूर्ति</color> है। घृणित कार्य! अपने लोगों को <color=#ef933d>युवा एम्बला की नक्काशी</color> प्राप्त करने के लिए इसे नष्ट करने का आदेश दें।"],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%>एक नया कैंप खोला गया है! इसे विश्व मानचित्र में देखें!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%>मैं फिर से आज़ाद हूँ! आपको बहुत-बहुत धन्यवाद! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>हमारी जनजाति के लोग इन <color=#38c0a5>टोटम</color> में फंसे हुए हैं।"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>जनजाति को यहां अन्य जनजातीय सदस्यों को खोजने के साथ-साथ घर वापस लाने के लिए आपकी सहायता की आवश्यकता है।"],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>अगले लेवल में उन्हें खोजें!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"इससे प्राप्त करने के लिए आप यहां किसी को बुलाने के लिए कुछ वस्तुओं पर <color=#f58c26>डबल-टैप</color> कर सकते हैं।"],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>आप अपने द्वारा एकत्रित की गई वस्तुओं का उपयोग या उन्हें मर्ज कर सकते हैं।"],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>एक <color=#38c0a5>जंगली रुन ऑर्ब</color> प्राप्त करने के लिए <color=#38c0a5>स्पिरिट फूल</color> से प्राप्त करें।"],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#38aec0>निष्क्रिय भूमियों</color> को जगाने के लिए <color=#f58c26>ऑर्ब पर टैप करें</color>।"],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%>अब से, आप प्रत्येक लेवल के अंत में पुरस्कारों का चयन कर सकते हैं।"],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>पुरस्कार आमतौर पर <color=#38c0a5>सोना</color> या अन्य उपयोगी संसाधन होते हैं। कभी-कभी टोटम भी!"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>आपके पुरस्कार <color=#f58c26>बुलबुलों</color> में डाल दिए जाएंगे और घर वापस भेज दिए जाएंगे।"],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>यह हमारी <color=#f58c26>मातृभूमि</color> है।"],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>यहां हमारा घर हुआ करता था<color=#f58c26>भयंकर बाढ़</color> ने हमारे शांतिपूर्ण जीवन को नष्ट कर दिया, जिससे भूमि पर घना कोहरा छा गया।"],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>भूमि को सीधे जागृत करने के लिए निष्क्रिय भूमि पर वस्तुओं को मर्ज करें! अधिक जनजातीयसदस्यों को बचाने के लिए मर्ज करने का प्रयास करें! आपकी आबादी जितनी बड़ी होगी, आप उतने ही अधिक कोहरे को हटा सकते हैं और उतनी ही तेजी से आप हमारे घर का पुनर्निर्माण कर सकते हैं।"],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>आप एक बार में केवल एक <color=#38c0a5>समय वाला खजाने का संदूक</color> अनलॉक कर सकते हैं। उन्हें प्राप्त करने के लिए उलटी गिनती के अंत की प्रतीक्षा करें, या किसी भी <color=#38c0a5>समय वाले खजाने के  संदूक</color> को तुरंत प्राप्त करने के लिए रूबी खर्च करें।"],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>लेवक के पुरस्कार आ गए हैं! बुलबुले खोलें और उन्हें देखें!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>लांगहाउस</color> वे स्थान हैं जहां श्रमिकों को कुछ आराम मिल सकता है। वे एक निश्चित समय के बाद बाहर आएंगे।"],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>लांगहाउस</color> को हाई लेवल वाले लांगहाउस में मर्ज किया जा सकता है। लेवल जितना अधिक होगा, जनजातीय सदस्यों को अंदर आराम करने में उतना ही कम समय मिलेगा।"],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>उन्हें तुरंत जगाने के लिए <color=#38c0a5>रूबी</color> खर्च करें।"],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"अधिक <color=#38c0a5>भूली हुई विरासत</color> प्राप्त करने के लिए आप मातृभूमि में अधिक कार्य पूरे कर सकते हैं। विशेष पुरस्कार प्राप्त करने के लिए उन पर टैप करें!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>यह <color=#38c0a5>सोने</color> का छोटा टुकड़ा है।"],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>कुछ <color=#38c0a5>सोना</color> प्राप्त करने के लिए आप उन पर टैप कर सकते हैं, यह आप उन्हें अधिक उन्नत गोल्ड नगेट में मर्ज कर सकते हैं।"],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>आप <color=#f58c26>दुकान</color> पर अपना </color>सोना<color=#38c0a5> खर्च कर सकते हैं।"],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>क्या बहुत ज्यादा सोना है? आप दुकान से कुछ बढ़िया सामान खरीद सकते हैं!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>सभी <color=#df66a8>जनजातीय सदस्य</color> बहुत थके हुए हैं। उन्हें अपनी ऊर्जा बहाल करने के लिए विराम की जरूरत है।"],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>अधिक लेवल जीतने और ज्यादा लोगों को बचने का समय!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>आपके पास जितने अधिक जनजातीय सदस्य होंगे, सोने से पहले वे आपके लिए उतने ही अधिक संसाधन जुटा सकते हैं।"],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>अधिक जनजातीय सदस्यों को बचाने के लिए लेवल जीतें।"],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%>और उन्हें घर वापस लायें!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>देखो! आप <color=#f58c26>विश्व मैप</color> पर टैप करके कैंप में जा सकते हैं।"],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>अब कुछ भी रखने की जगह नहीं है: जमीन पूरी तरह से ढकी हुई है!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>एक वस्तु का चयन करें, और इसे बेचने या त्यागने के लिए सूचना बॉक्स में चुनें। "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"यह एक <color=#38c0a5>विदेशी विरासत</color> है, यह अत्यंत दुर्लभ है! <color=#38c0a5>रूबी</color> प्राप्त करने के लिए इस पर टैप करें! या आप उन्हें और अधिक उन्नत विरासतों में मर्ज कर सकते हैं!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>यह एक <color=#38c0a5>जंगली अयस्क</color> का टुकड़ा है।"],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>आप <color=#38c0a5>जंगली अयस्कों</color> को एकत्र करने के लिए उन पर टैप कर सकते हैं, या आप और अधिक उन्नत अयस्क प्राप्त करने के लिए उन्हें मर्ज कर सकते हैं!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>आप <color=#f58c26>दुकान</color> पर एकत्र किए गए <color=#38c0a5>जंगली अयस्क</color> को खर्च कर सकते हैं।"],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%>यदि आपका <color=#38c0a5>जंगली अयस्क</color> का भंडारण बहुत अधिक पैक हो रहा है, तो आप उन्हें दुकान पर भी खर्च कर सकते हैं।"],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"यह <color=#38c0a5>रोडब्लॉक</color> यहाँ मुझे बहुत परेशान करता है! लेकिन आप इसे सीधे स्थानांतरित नहीं कर सकते। आप अपने <color=#df66a8>जनजातीय सदस्यों</color> को इस पर हमला करने का आदेश दे सकते हैं ताकि इसे छोटे-छोटे रोडब्लॉक में तोड़ा जा सके।"],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>बारबेट्स</color> निष्क्रिय भूमि पर रहते हुए भी भूमि को दूषित करते हैं। <color=#f58c26>प्रोग्रेस बार</color> प्रत्येक फायरिंग के बीच का समय दिखाता है। आप केवल एक जागृत बारबेट पर हमला कर सकते हैं।"],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"यह एक <color=#f58c26>हीरो की वेदी</color> है। हीरो <color=#f58c26>निष्क्रिय मोड</color> और <color=#f58c26>गश्त मोड</color> के बीच स्विच करेंगे।"],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"हीरो के आस-पास होने के साथ, किन्हीं भी <color=#f58c26>4 वस्तुओं को मर्ज करने</color> पर अतिरिक्त आश्चर्य होंगे!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"अगर वे निष्क्रिय हैं तो आप उन्हें तुरंत जगाने के लिए <color=#38c0a5>रूबी</color> खर्च कर सकते हैं।"],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"हीरो की कुछ जानकारी देखने के लिए आप यहां क्लिक कर सकते हैं"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>जनजाति की मजबूत इकाइयों की तरह हीरो में अद्वितीय क्षमताएं होती हैं।"],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>आप यहां <color=#f58c26>हीरो क्षमता बॉक्स</color> में हीरो की क्षमताओं का विवरण देख सकते हैं।"],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>आप पूरे किए गए <color=#f58c26>क्वेस्ट</color> सबमिट करके हीरो का लेवल बढ़ा सकते हैं।"],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"अपने हीरो का लेवल बढ़ाने के लिए सभी क्वेस्ट पूरे करें।"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%>बहुत बढ़िया! अधिक जनजातीय सदस्य जादूगर की सील से मुक्त हुए!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"अपनी जनजाति में अधिक सदस्यों के साथ आप अधिक <color=#f58c26>कोहरा</color> हटा सकते हैं!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>प्रत्येक क्षेत्र में कोहरे को हटाने करने के लिए जनजातीय शक्ति के एक निश्चित स्तर की आवश्यकता होती है।"],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>अब हम इस क्षेत्र में कोहरा हटा सकते हैं!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"आप अभी इस कोहरे को नहीं हटा सकते।"],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>आपकी <color=#f58c26>जनजातीय शक्ति</color> अभी पर्याप्त नहीं है। आप दुकान में अधिक टोटम खरीद सकते हैं।"],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%>टोटम खरीदने के लिए सोना खर्च करें!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>प्रत्येक खरीद के बाद टोटम की कीमत में वृद्धि होगी। जाएं और अधिक सोना प्राप्त करें!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>इस स्तर की एक <color=#f58c26>समय सीमा</color> है। आपको बताई गई समय सीमा में ट्रायल पूरा करना होगा, अन्यथा आप हार जाएंगे।"],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>आप यहां देख सकते हैं कि कितना समय बचा है।"],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>जैसे-जैसे समय कम होता जाएगा, संख्याओं का रंग <color=#46bb83>हरे</color> से <color=#eca852>पीला</color> और अंत में <color=#e04030>लाल</color> हो जाएगा।"],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%>लेवल को तेजी से जीतने के लिए, आप दुकान की जांच कर सकते हैं।"],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>आप सीधे दुकान से प्रमुख वस्तुओं को खरीदने के लिए <color=#38c0a5>रूबी</color>' खर्च कर सकते हैं।"],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%>इस प्रकार के लेवल आपको पुरस्कार के रूप में एक <color=#38c0a5>जनजातीय सदस्य</color> प्रदान करते हैं। आप अपने पुरस्कारों को दोगुना करने के लिए <color=#38c0a5>रूबी</color> खर्च कर सकते हैं।"],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>एक औरगोड्स ट्रायल में आपका स्वागत है! चुनौती को हराने के बाद आपको एक इनाम भी मिलेगा।"],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>आप एक ट्रायल <color=#f58c26>तीन बार</color> पूरा कर सकते हैं, लेकिन समय सीमा हर बार कम होती जाएगी।"],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>अगले लेवल के लिए आपको हीरो के प्रशिक्षण सत्र की प्रतीक्षा करनी होगी, या आप प्रक्रिया को तेज करने के लिए <color=#38c0a5>रूबी</color> खर्च कर सकते हैं।"],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>देखिए, यह एक <color=#46bb83>इनले आला</color> है, यह कोहरे के एक बड़े क्षेत्र को नियंत्रित करता है।"],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%>कोहरे को साफ करने के लिए संबंधित वस्तु को आले में खींचें।"],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Iयदि आला अभी भी निष्क्रिय है, तो आपको इसे पहले जागृत करना होगा।"],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>एक इवेंट में आपका स्वागत है! यह केवल सीमित समय के लिए ही खुली रहेगी!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>किसी इवेंट में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और उन्हें आपकी मातृभूमि में भेज दिया जाएगा!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव और गेमप्ले के नए रूप दिखाई देंगे!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>लेवल में आगे बढ़ने के लिए मशालें आवश्यक हैं! वे समय के साथ फिर से भरती हैं।"],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Yआपके पास अब बहुत सारी मशालें हैं! लेवल में खेलने के लिए उनका उपयोग करें!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%>अब से, आप अपना <color=#38c0a5>कैंप पुरस्कार</color> देख सकते हैं!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>जब समय हो, तो आप अपने पुरस्कारों का दावा कर सकते हैं!"],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%>आपको लेवल में जितने अधिक सितारे मिलेंगे, आपको उतने ही अधिक पुरस्कार मिलेंगे!"],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>देखो! यह मानचित्र पर ठीक वहां है! इसे अनलॉक करें और इसे देखें!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>हमारे स्काउट को एक नए कैंप के लिए एक नया स्थान मिला है, इसे देखें!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>हम यहां किसी दिलचस्प व्यक्ति से मिल सकते हैं!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%><color=#46bb83>शीतकालीन पलायन इवेंट</color> में आपका स्वागत है, एक अद्भुत दुनिया आपका आगे इंतजार कर रही है!"],
12799=>["Value"=>12799,"TextKey"=>"新手引导说明2321","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
12800=>["Value"=>12800,"TextKey"=>"新手引导说明2322","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव और गेमप्ले के नए रूप दिखाई देंगे!"],
12801=>["Value"=>12801,"TextKey"=>"新手引导说明2330","TextValue"=>"<line-height=130%><color=#46bb83>परियों की कहानी का शहर इवेंट</color> में आपका स्वागत है, एक अद्भुत दुनिया आपका आगे इंतजार कर रही है!"],
12802=>["Value"=>12802,"TextKey"=>"新手引导说明2331","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
12803=>["Value"=>12803,"TextKey"=>"新手引导说明2332","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव और गेमप्ले के नए रूप दिखाई देंगे!"],
12804=>["Value"=>12804,"TextKey"=>"新手引导说明2340","TextValue"=>"<line-height=130%><color=#46bb83>समुद्र की ओर</color> में आपका स्वागत है, एक अद्भुत दुनिया आपका आगे इंतजार कर रही है!"],
12805=>["Value"=>12805,"TextKey"=>"新手引导说明2341","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
12806=>["Value"=>12806,"TextKey"=>"新手引导说明2342","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव और गेमप्ले के नए रूप दिखाई देंगे!"],
12807=>["Value"=>12807,"TextKey"=>"新手引导说明2350","TextValue"=>"<line-height=130%>यह एक <color=#46bb83>इवेंट अंक वस्तु</color> है जो इवेंट्स में विशेष है। कुछ रसीले <color=#46bb83>इवेंट अंकों</color> के लिए इस पर टैप करें!"],
12808=>["Value"=>12808,"TextKey"=>"新手引导说明2352","TextValue"=>"<line-height=130%>यह पेज आपको उन सभी पुरस्कारों को दिखाता है जो आप इवेंट में अंक एकत्रित करके प्राप्त कर सकते हैं। एक बार जब आप पर्याप्त अंक प्राप्त कर लेते हैं, तो संबंधित <color=#46bb83>इवेंट अंक पुरस्कार</color> आपकी <color=#f58c26>मातृभूमि</color> को भेज दिया जाएगा।"],
12809=>["Value"=>12809,"TextKey"=>"新手引导说明2353","TextValue"=>"आप जितने अधिक अंक एकत्र करेंगे, आपको उतने ही अधिक पुरस्कार मिलेंगे! जाओ कुछ मजा करो!"],
12810=>["Value"=>12810,"TextKey"=>"新手引导说明3200","TextValue"=>"<line-height=130%><color=#f58c26>दैनिक कार्य</color> उपलब्ध हैं, आगे बढ़ो और उन्हें देखो!"],
12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>प्रतिदिन आपके लिए कई <color=#f58c26>दैनिक कार्य</color> होते हैं। उनमें से किसी एक को पूरा करने पर आपको हर बार पुरस्कृत किया जाएगा।"],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%>अगर आप सभी <color=#f58c26>दैनिक कार्य</color> पूरे कर लेते हैं तो आपको <color=#f58c26>अतिरिक्त इनाम</color> मिलेगा! "],
12813=>["Value"=>12813,"TextKey"=>"新手引导说明2420","TextValue"=>"<line-height=130%>हाय, मैं म्याऊ-म्याऊ हूँ, और <color=#46bb83>म्याऊ म्याऊ</color> राज्य में आपका स्वागत है! मेरा अद्भुत क्षेत्र आपका आगे इंतजार कर रहा है!"],
12814=>["Value"=>12814,"TextKey"=>"新手引导说明2421","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
12815=>["Value"=>12815,"TextKey"=>"新手引导说明2422","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव (मैं!) और गेमप्ले के नए रूप दिखाई देंगे!"],
12816=>["Value"=>12816,"TextKey"=>"新手引导说明2430","TextValue"=>"हम कहाँ है? मुझे विश्वास नहीं हो रहा है कि हम प्राचीन मिस्र में हैं, जहां <color=#46bb83>फिरौन का रहस्य</color> आपके द्वारा रहस्य पर से परदा उठाये जाने की प्रतीक्षा कर रहा है!"],
12817=>["Value"=>12817,"TextKey"=>"新手引导说明2431","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
12818=>["Value"=>12818,"TextKey"=>"新手引导说明2432","TextValue"=>"<line-height=130%>यहां आपको कुछ अनूठी वस्तुएं, नए जीव और गेमप्ले के नए रूप दिखाई देंगे!"],
12819=>["Value"=>12819,"TextKey"=>"新手引导说明2460","TextValue"=>"पार्टनर आप कैसे हैं! <color=#46bb83>जंगली पश्चिम</color> में आपका स्वागत है!"],
12820=>["Value"=>12820,"TextKey"=>"新手引导说明2461","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color> को भेजे जाएंगे!!"],
