12825=>["Value"=>12825,"TextKey"=>"新手引导说明2500","TextValue"=>"<line-height=130%>यह एक <color=#46bb83>इवेंट अंक वस्तु</color> है जो इवेंट्स में विशेष है। कुछ रसीले <color=#46bb83>इवेंट अंकों</color>के लिए इस पर टैप करें!"],
12826=>["Value"=>12826,"TextKey"=>"新手引导说明2502","TextValue"=>"<line-height=130%>यह पेज आपको उन सभी पुरस्कारों को दिखाता है जो आप इवेंट में अंक एकत्रित करके प्राप्त कर सकते हैं। एक बार जब आप पर्याप्त अंक प्राप्त कर लेते हैं, तो संबंधित <color=#46bb83>इवेंट अंक पुरस्कार</color> आपकी <color=#f58c26>मातृभूमि</color> को भेज दिया जाएगा।"],
12827=>["Value"=>12827,"TextKey"=>"新手引导说明2503","TextValue"=>"आप जितने अधिक अंक एकत्र करेंगे, आपको उतने ही अधिक पुरस्कार मिलेंगे! जाओ कुछ मजा करो!"],
12828=>["Value"=>12828,"TextKey"=>"新手引导说明2510","TextValue"=>"चलिए <color=#46bb83>खिलौने के पैराडाइज</color>में अपने बचपन के सपने को साकार करें!"],
12829=>["Value"=>12829,"TextKey"=>"新手引导说明2511","TextValue"=>"<line-height=130%>इस तरह की <color=#46bb83>इवेंट</color> में भाग लेने से आपको ढेर सारे पुरस्कार मिलते हैं, और वे आपकी <color=#f58c26>मातृभूमि</color>को भेजे जाएंगे!!"],
