13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>मेरे चीफ आप कैसे हैं, मैं ट्रिस्टन हूँ, आपका स्काउट! मुझे खुशी है कि हम सब उस कठिन यात्रा से बच गए। अंत में हम जमीन पर पहुंच गए, तो चलिए एक <color=#f58c26>कैंप</color> लगाते हैं। "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>यह काफी समृद्ध जगह है! पता नहीं हम यहाँ क्या कर सकते हैं? आइए अपनी सुरक्षा के लिए अपने तंबू को खड़ा करके शुरुआत करें!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>हे प्रिय प्रभु, इस बदसूरत गंदगी को... और इस बदसूरत तंबू को देखो! मुझे घर की बहुत याद आ रही है..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"अब, एंडा, मुझे पता है कि घर छोड़ना मुश्किल होता है, लेकिन इसे बचाने का एकमात्र तरीका छोड़ना था। सबसे विचित्र आपदाएं... हमें इसका उत्तर खोजना होगा! इसलिए हमने मदद लेने के बारे में सोचा।"],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%>लेकिन हम वापसी का रास्ता खोज लेंगे, ठीक है? आइए एक <color=#f58c26>वेदी</color> बनाकर शुरू करें ताकि आप भगवान से बात कर सकें, वह कैसा है, पुजारी एंडा? चीफ मदद करेंगे!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>देखो हमें क्या मिला! <color=#ef933d>जंगल की विरासत</color>! <color=#f58c26>वेदी</color> के लिए हमें यही सब कुछ चाहिए, और हमें उन टोटम से मुक्त होने का एक तरीका मिल गया! यह स्थान धन्य है!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>मुझे लगता है कि आप पूरी तरह से बेकार नहीं हैं, स्टेन या कुछ और। हालाँकि यह मेरे घर की तुलना में बहुत छोटा और भारी है, यह अभी के लिए पर्याप्त होगा! अब जाओ!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>ओह, कितनी प्यारी है, देखो वह कितनी खुश है और धन्यवाद कहने का उसका तरीका बहुत ही निराला है!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (एक अजीब नृत्य समाप्त) हमारे भगवान ने मुझसे कहा कि हम सही जगह पर हैं और एक महान व्यक्ति हमारी सहायता के लिए आ रहा है..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>वास्तव में? ये तो अच्छी खबर है! हम इस महान शख्सियत से कब मिलेंगे?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>दुष्टों तुमनें मेरी नींद में खलल क्यों डाला?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>......और तुम कौन हो?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>मैं आर्कड्र्यूड हूँ, बार्ड्स का पिता, तूफान पर विजय प्राप्त करने वाला, साहसी कार्यों का रक्षक, भगवान का भयानक दूत, निष्पादक और न्यायाधीश, जप करने वाला आमेरगिन हूँ! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>आह...तुमसे मिलकर अच्छा लगा, मुझे लगता है? हम इस क्षेत्र में नए हैं और हमने बस सुना..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>क्या?! तुम आक्रमणकारी हो?! तुम हमारे घरों को नष्ट करने और परिवारों को अलग करने का कोई मौका नहीं छोड़ोगे! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"क्या? नहीं, नहीं! हम आक्रमणकारी नहीं हैं, हम बस आराम करने के लिए जगह खोजने की कोशिश कर रहे हैं, और शायद अपनी मातृभूमि के रहस्य को सुलझा रहे हैं……"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"नहीं! पुल! देखो तुमने क्या किया! भगवान पागल हो जाएगा! रुको... तुमने कहा कि तुम कौन थे? आमेरगिन? आर्कड्र्यूड आमेरगिन? किंवदंतियों से?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"तुम…… आक्रमणकारी नहीं हो? तुम कौन हो? तुम यहां क्यों आये हो? रुको... मैं यहाँ क्यों हूँ, और यह कौन सी जगह है? मेरे लोग कहाँ हैं? मुझे यह जगह याद नहीं है..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"मुझे बहुत खेद है, लेकिन हमारे पास भी जवाब भी नहीं है। हमने बहुत दूर तक यात्रा की, यहाँ पहुँचने के लिए अपनी जान जोखिम में डाली, ऐसे मददगार खोजने की कोशिश की जो हमारी मातृभूमि के रहस्य को सुलझा सकें। पहले हम पर घना कोहरा छाया, फिर..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"पिछले दशक की तुलना में पिछले साल में हमारे यहाँ ज्यादा बाढ़ आई है। फिर भी सबसे दिलचस्प बात यह है कि लोग बेजान टोटम में बदल रहे हैं! क्या तुम विश्वास करोगे?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"ओह...मुझे...यह सब नहीं पता था। आप पर हमला करने और आपके पुल को नष्ट करने के लिए क्षमा करें। शायद मैं इसे फिर से बनाने में मदद कर सकता हूँ?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"आमेरगिन?! शक्तिशाली आमेरगिन?! आपकी पोशाक, तूफ़ान को नियंत्रित करने की शक्ति... आप असली हैं! इसका मतलब है कि मेरे परिवार की किताब में वे किस्से असली हैं!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>श्रमिको! एक साथ मिलकर उस पुल का पुनर्निर्माण करो!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>लेकिन हम घायल हैं! अभी हम निर्माण कार्य नहीं कर सकते! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"मुझे मालूम है। मैंने कई वर्षों की यात्रा के दौरान जड़ी-बूटियों से बनी दवा के बारे में सीखा है। चलो कुछ जड़ी-बूटियाँ इकट्ठा करते हैं और यहाँ एक <color=#f58c26>जड़ी बूटी का बगीचा</color> उगाते हैं, इसे क्षमा व्यक्त करने का मेरा तरीका समझें।"],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"धन्यवाद! आप बहुत दयालु हैं। टोटम में फंसे लोगों को रिहा करने के लिए हम बाद में घर वापस जाएंगे, क्योंकि अब हमने ऐसा करने का तरीका सीख लिया है! बढ़िया, चलो चलें!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>हम वापस आ गए हैं, और हम घर से मददगार लाए हैं! चलो फिर बगीचा बनाते हैं!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>वाह, यह नहीं कह सकता कि मैं प्रभावित नहीं हूँ, आप वास्तव में इस काम में माहिर हैं। यह छोटा सा बगीचा सुंदर है। "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>और बहुत उपयोगी भी। श्रमिकों का अब इलाज किया जा रहा है और जल्द ही वे पुल के पुनर्निर्माण के लिए तैयार हो जाएंगे!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%>मुझे खुशी है कि मैं मदद कर सका।"],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"जिसके बारे में बोलते हुए, वास्तव में, यहाँ पुजारी सिर्फ इस बारे में बात कर रहे थे कि आप कितने गुणी और ज्ञानी हैं। मैं जो कहने की कोशिश कर रहा हूँ वह है कि……"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"यह एक सम्मान की बात होगी यदि एक अनुभवी साहसी और आप जैसी महान शख्सियत हमारे साथ जुड़ सकें। लेकिन आप एक किंवदंती हैं! किसी भी तरह से आप कुछ अजीब अजनबियों में शामिल नहीं होंगे! क्या आप होंगे? कृपया? कृपया हमारे साथ आएं!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>ज़रूर। शायद इसीलिए मुझे यहाँ भेजा गया है।"],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>मुझे पता था। आप नहीं……क्या?! क्या आप हमारे साथ आ रहे हैं?! ओह, मुझे विश्वास नहीं हो रहा है……मेरे जीवन का सबसे अच्छा दिन! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"क्षमा करें, वह कभी-कभी बहुत उत्साहित हो जाती है। तो अब जब आप हमारे साथ जुड़ गए हैं, तो हम आपके लिए एक स्वागत दावत की मेजबानी कैसे करेंगे?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"नहीं, मैं एक दावत के बिना ठीक हूँ, मेरे पास और अधिक अहम मामले हैं। मैं उस पुल के पुनर्निर्माण के लिए कुछ लकड़ी की तलाश करने जा रहा हूँ जिसे मैंने तोड़ा था।"],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>क्या सम्माननीय व्यक्ति है! ओह! बस उनसे मिलने के लिए……मेरे जीवन का सबसे अच्छा दिन!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>क्या आप चीफ हैं...हैं ना? हमारी मदद करने के लिए धन्यवाद। अब हम पुल के पुनर्निर्माण के लिए तैयार हैं।"],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%>नए की तरह शानदार! अब, क्या आप फिर से परमेश्वर से बात करने के लिए उत्साहित हैं, पुजारी एंडा?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>पहले से कहीं ज्यादा तैयार! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"<line-height=130%>ठीक है, चीफ, जैसा कि पुजारी अपनी प्यारी वेदी के साथ अपने पुनर्मिलन का आनंद ले रही हैं, तब तक हम कुछ काम कर सकते हैं..."],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"आउच, मुझे क्या चुभा? हुह, <color=#f58c26>वेदी</color> से <color=#38c0a5>जंगली अयस्क</color> का एक टुकड़ा। काम करते समय आप लोग बहुत लापरवाही करते हैं।"],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%>आह हा, मुझे पता है! हमें संसाधनों को स्टोर करने के लिए एक <color=#f58c26>गोदाम</color> बनाने की जरूरत है, ताकि लोग जगह-जगह पड़ी सामग्री के ऊपर न गिरें।"],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>हमें जो चाहिए वह सब मिल गया? तो चलिए दावत शुरू करते हैं! क्षमा करें, मेरा मतलब है <color=#f58c26>गोदाम</color>।"],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>पक्की दीवार, अच्छी और बड़ी जगह... बढ़िया निर्माण कौशल, चीफ!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>आह…… श्रीमान? आपके ठीक पीछे आठ टाँगों वाली कोई चीज़ है।"],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"क्या?! किस तरह?! यह क्या है?! यह पानी में रहने वाला कोई प्राणी लगता है... हम्म, पतली और फैलने वाली त्वचा!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>क्रैकेन</color>! यह <color=#f58c26>क्रैकेन</color> है! मैंने उनके बारे में किताबों में पढ़ा है! यह उस राक्षस का बच्चा होना चाहिए! वहां एक <color=#f58c26>क्रैकेन</color> क्यों है?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"डरने की कोई जरूरत नहीं है। पहली बात कि यह मृत हा और दूसरी यह बस एक साधारण <color=#f58c26>ऑक्टोपस</color> है।"],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>ऑक्टोपस? इनके बारे में पहले कभी नहीं सुना..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"इसका मतलब है कि आप लोग देश के भीतरी भाग में रहने वाले लोग होने चाहिए, हुह। मेरे लोग खानाबदोश हैं। हम समुद्र पर निर्भर हैं। हमारे लिए ऑक्टोपस उतने ही सामान्य हैं जितने रात के आसमान में तारे।"],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"दरअसल, मेरे साथ आइए, कुछ रस्सियां और शाखाएं ढूंढते हैं। मैं आपको दिखाऊंगा कि कैसे एक ऑक्टोपस की त्वचा के साथ एक तम्बू का निर्माण किया जाता है।"],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>....और यह हो गया। यह मेरी कल्पना में बहुत बेहतर लग रहा था।"],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>यह...सुंदर है!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"क्षमा करें। मैं व्यवाहरिक से अधिक सिद्धांत लागू करने वाला व्यक्ति हूँ। निर्माण मेरा मजबूत विषय नहीं है। अब……मुझे लेटना चाहिए……"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"ओह महान आमेरगिन! आप मुख्य तम्बू में आराम क्यों नहीं करते, और मैं आपके साथ रहूँगी! आपने मुझे अपना ज्ञान दिया है, और मैं हमेशा आपकी सेवा में मौजूद रहूँगी।"],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"यह पुजारी के लिए बचपन का सपना सच होने ऐसा होना चाहिए। मैं उन दोनों को साथ देखकर खुश हूँ। हालाँकि, सब कुछ थोड़ा अजीब लगता है, क्या आपको नहीं लगता, चीफ?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"बड़े-बुजुर्गों ने कहा कि जो लोग समुद्र की यात्रा के लिए गये, वे कभी वापस नहीं आए, सिवाय उसके जो एक पागल आदमी के रूप में वापस आया, वह दुनिया के सिरे पर पानी से बने एक विशाल अवरोध के बारे में बात कर रहा था।"],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>फिर भी उस आमेरगिन ने कहा कि वे समुद्र के लोग हैं! कोई भी लोग समुद्र पर नहीं रहते!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>इसलिए यह अजीब है। लेकिन किसी भी तरह, उसने हमें कोई नुकसान नहीं पहुंचाया है। आइए अभी के लिए अपने काम पर डटे रहें। "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>अब आपने चारों ओर खोज-बीन कर ली है, हमें मिली ट्राफियों की मात्रा बहुत अधिक है। कुछ पशु उन्हें घर ले जाने में मदद कर सकते हैं। और उनके आराम के लिए हमें उनके लिए एक <color=#f58c26>पशुओं का छप्पर</color> बनाना चाहिए।"],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>अच्छा लग रहा है, चीफ! ऐसा लगता है कि ये छोटे जीव तुरंत काम आएंगे, शानदार!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>हमारा निर्माण का काम लगभग हो गया है, हालांकि एक आखिरी चीज है जिसके लिए मुझे आपकी मदद की ज़रूरत है।"],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>यदि हमारे जाने के बाद कुछ बुरे इरादे वाले लोग हमारे शिविर को बर्बाद कर देते हैं, तो हमें क्षेत्र में गश्त करने और यहां हमारे काम की रक्षा करने के लिए एक पेशेवर स्काउट टीम की आवश्यकता है।"],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>हमें एक <color=#f58c26>प्रशिक्षण रिंग</color> चाहिए होगी!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>ठीक कहा केविन, एक <color=#f58c26>प्रशिक्षण रिंग</color>। चलो कुछ सामग्री ढूंढें!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>क्या तुम तैयार हो?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%>हाँ श्रीमान!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>चीफ ने सामग्री तैयार कर ली है, तो चलिए शुरू करते हैं!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>ठीक है श्रीमान! कोई समस्या नहीं है!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>बहुत बढ़िया! और अब हम.....पुजारी? क्या हुआ?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"मैं आर्कड्र्यूड आमेरगिन के साथ बात कर रही थी, तब हम दोनों थकावट के कारण सो गए, और दोनों को यह अजीब सपना आया जिसमें एक देवी ने हमसे कहा, <color=#f58c26>समुद्र के हृदय</color> को बचाओ...""],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>समुद्र का हृदय</color>? वह क्या है?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"हमें समुद्र में एक विशाल बुलबुले वाली एक पुरानी कहानी पता है, जो सबसे छोटी देवी द्वारा संरक्षित है। इसमें न केवल प्राचीन जानवर जीवित बच गए, बल्कि दानव और परियां अभी भी जीवित हैं। लेकिन यह बस सोने के समय सुनाई जाने वाली कहानी है।"],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>मुझे इसकी तह तक जाना चाहिए। देवी से एक स्पष्ट संदेश प्राप्त करने के लिए, मुझे एक <color=#f58c26>शक्तिशाली रून आधार</color> की आवश्यकता होगी।"],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%>ठीक है! चीफ, चलो चलें और कुछ जंगली अयस्क लाकर एंडा के लिए वह आधार बनायें।"],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>यह लगभग हो गया! हमे जश्न मानना चाहिए!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>हूरे!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>अभी जश्न ना मनाएं! जब आप शोर-शराबा करेंगे तो मैं ध्यान नहीं लगा सकूंगी!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>मैं भगवान के साथ फिर से जुड़ने की कोशिश कर रही थी और तुम शोर मचाने वाले बेवकूफों ने सब बर्बाद कर दिया!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>अपना मुंह बंद करो और मुझे अकेला छोड़ दो!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>ओह, लगता है किसी का दिन बहुत अच्छा नहीं है।"],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>रुको! चुप! मुझे लगता है मैं उन्हें सुन सकती हूँ। यह बहुत महत्वपूर्ण है।"],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"हम्म...मैं बहुत स्पष्ट रूप से नहीं सुन सकती... लेकिन मैं जो अनुमान लगा रही हूँ वह है कि... हमें उत्तर की ओर जाना चाहिए, जहां कुछ भी विकसित नहीं हो सकता है, और कुछ भी जिंदा नहीं रह सकता है। वहां हमें एक दोस्त मिलेगा।"],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>ठीक है, क्या करने योग्य.....लगता है? मेरा मतलब है, क्या हो सकता है! यह उत्तर है! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"लेकिन इससे पहले, अंत में हमारे नए कैंप का जश्न मनाने का समय आ गया है! चारों ओर इकट्ठा हो जाओ, क्योंकि हम एक शानदार दावत करने वाले हैं!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>हूरे!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"हमने यह सोचकर घर छोड़ दिया कि हम फिर कभी नहीं लौट सकते, फिर भी हमें यह अविश्वसनीय द्वीप मिला, नए दोस्तों से मुलाकात की, और यहां तक ​​कि जनजातीय सदस्यों को पुनर्जीवित करने के तरीके भी खोजे, जिनके बारे में हमने सोचा था कि हमने उन्हें हमेशा के लिए खो दिया है।"],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"इस सब के लिए, हमें अपनी देवी, जो हमारी देखभाल कर रही हैं और हमारा मार्गदर्शन कर रही हैं, हमारे नए दोस्त, प्रिय आमेरगिन को धन्यवाद देना होगा, जो निस्वार्थ रूप से हमें अपना अविश्वसनीय ज्ञान दे रहे हैं।"],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"लेकिन सबसे महत्वपूर्ण बात, चीफ, यदि आप मजबूत और दयालु नहीं रहते तो हम इसमें से कुछ भी पूरा नहीं कर सकते थे। तो धन्यवाद चीफ, आपने हमारे लिए जो कुछ किया है, और……उह……पुजारी, क्या आप रो रही हैं?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"मैं…मैं नहीं…*सूं-सूं* रो रही हूँ……बस……*सूं-सूं * ठीक है मैं! मैं रो रही हूँ! अब क्या आप सब संतुष्ट हैं?! आई लव यू चीफ! आप सबसे अच्छे चीफ हैं!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"हाहा, मेरा मानना है कि इन्होने सब कुछ कह दिया, चीफ। मैं यह देखने के लिए इंतजार नहीं कर सकता कि हमारी आगे की यात्रा कैसी होगी, और एक दिन, हम निश्चित रूप से अपने घर के रहस्य को सुलझाएंगे, और अपने घर का पुनर्निर्माण करेंगे।"],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>लड़कों जल्दी मत करो, हम लगभग पहुँच गए हैं……"],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>भगवान भला करे! हम कई दिनों से रेगिस्तान में घूम रहे हैं, या क्या आप मुझे कुछ पानी दे सकते हैं? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>थोड़ा धैर्य रखो! जब मैं तुम्हारी उम्र की थी.... सुनो, वह क्या है?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>ओह!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>पुजारी?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>अरे नहीं, क्या आप नीचे हैं पुजारी? क्या आप ठीक हैं?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%>खैर... मैं अभी जिन्दा हूँ...हम्म, मुझे लगता है मुझे इस जादुई खदान ने नीचे खींच लिया है?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>भगवान का शुक्र है आप ठीक हैं, चिंता ना करें, हम जल्द से जल्द आपको यहाँ से बाहर निकालने के जो कर सकते हैं करेंगे।"],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>चीफ, मुझे पास में एक पहाड़ी की चोटी पर एक परित्यक्त इमारत मिली। मैंने अंदर एक बड़ी स्ट्रॉ रोप मशीन देखी, लेकिन यह एक घिनौनी गंदगी में घिरा हुई है।"],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>मुझे लगता है कि यह किसी प्रकार की एक <color=#f58c26>पुराणी वर्कशॉप</color> है।"],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>हम उसका दरवाजा खोलने और उसे साफ करने की कोशिश कर सकते हैं ताकि हम रस्सी की चरखी बना सकें और पुजारी को बाहर खींच सकें।"],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>ठीक है बाते करना बंद करो और चरखी बनाओ!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"शांत हो जाओ पुजारी! अंधेरा हो रहा है, जल्द ही यहाँ ठंड हो जाएगी! इसलिए हमें पहले एक <color=#f58c26>तम्बू</color> बनाने के लिए सामग्री खोजनी होगी, और जब सब लोग आराम कर लेंगे फिर हम इसका समाधान करने की कोशिश करेंगे।"],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>लेकिन मेरा क्या? मैं ठण्ड से मर सकती हूँ!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>चिंता ना करें, हालांकि दिन और रात के बीच जमीन के ऊपर तापमान का अंतर बहुत ज्याद होता है, पर भूमिगत तापमान हमेशा स्थिर और सुखद होता है। इसलिए आप वहीं रुकें पुजारी! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"अगले दिन....."],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%>रात को अच्छी नींद आई! मेरे पुजारी, आप नीचे कैसी हैं?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>मैं इस बात की सराहना करूंगी यदि आप अपनी ऊर्जा मुझे यहां से निकालने में लगाएं बजाय यह पूछने के लिए मैं कैसी हूँ!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>हम इस पर काम कर रहे हैं, आगे बढ़ने से पहले मुझे उस दरवाजे को तोड़ने के लिए बस कुछ आवश्यक उपकरण चाहिए। कृपया शांत रहें। *मुस्कान*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>तुम मेरे वापस ऊपर आने का इंतजार करो... छिछोरे, लीचड़..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>"<line-height=130%>आह, मेरी भावनाएं बहुत आहत हुई हैं! आपने कैसे मेरे नेक दिल को गलत समझ सकती हैं! लेकिन मैं आपको क्षमा करता हूँ। चीफ और मैं जल्द ही वापस आएंगे!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"ठीक है, हम अंदर हैं! अब बीएस हमें..."],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"श्रीमान, ध्यान से! आपके पीछे!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"आउच! यह तीर कहाँ से आया?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"इमारत से बाहर निकलो!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"वहां कौन है?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"बाहर निकलो! किड्नैपर!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"क्या किड्नैपर? मुझे लगता है आपने गलत इंसान को पकड़ लिया, आवाज वाली महिला...आउच, आउच, आउच!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"आवाज वाली महिला, हम इमारत से बाहर हैं, अब क्या तुम मुझे समझाओगी कि क्या हो रहा है?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"सबसे पहले, मेरा नाम आवाज वाली महिला नहीं है, मैं त्लचटगा हूँ, बिजली की शिकारी, मग रुइथ की बेटी, सारी धरती की माँ, नायिका……"],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>महान त्लचटगा!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"क्या……यह आवाज कहाँ……पहाड़ी की तलहटी से आई? कोई उस खदान में गिर गया?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"तुम तीनों, जब तक मैं वापस नहीं आ जाती, तब तक बिलकुल नहीं हिलना। अगर मुझे पता चलता है कि आप एक इंच भी आगे बढ़े हैं, तो आप जानते हैं कि क्या होने वाला है।"],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"हाँ, महोदया, एक इंच भी नहीं!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"मिल गई। क्या एक पुजारिन? तुम यहाँ क्या कर रही हो? जब मैं किसी को खोज रही थी तो मैं इस खदान में आ गई, आप इसमें कैसे आई?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"संक्षेप में, मैं उन तीन आदमियों के साथ थी जिन्हें आपने पकड़ा था, लेकिन मैं इस खदान में गिर गई। लेकिन यह महत्वपूर्ण नहीं है। आप यहाँ हैं! मैंने भविष्यवाणी की थी कि हम एक दोस्त से मिलेंगे जो इस बंजर भूमि पर हमारी मदद कर सकता है, मुझे विश्वास नहीं हो रहा है कि यह आप हैं!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>दोस्त? मदद आपकी? किस लिए? क्या तुम.... किड्नैपर नहीं हो?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>कौन किड्नैपर? नहीं नहीं , हम बस यहाँ से गुजर रहे थे, अपने घर को बचाने के लिए मददगारों की तलाश में! "बताते हुए""],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"हुह। अब जब आपने यह कह दिया, तो माँ ने आप जैसे लोगों के समूह से मिलने के बारे में कहा...लेकिन फिर वह गायब हो गई...तो इसका मतलब है कि मुझे गलत लोग मिले।"],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%>क्या माँ?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"इसके बारे में भूल जाओ, कोई बड़ी बात नहीं। मुझे लगता है कि आपके साथी उस रोप मशीन को चलाने की कोशिश करते समय मेरे जाल में फंस गए हैं, ताकि वे आपको बाहर निकाल सकते?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>हाँ बुद्धिमान महोदया, ठीक यही कारण है कि कैसे मैं इस तरह दिख रहा था, एक-पैर वाला।"],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"ओह प्रिय, मेरी गलती है, मैं बाद में तुम्हारे जख्म को ठीक करने में मदद करूंगी. फ़िलहाल मुझे मेरे जाल निकालने दें और आपके लिए यह रोप मशीन ठीक करने दें..."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>स्ट्रॉ रोप मशीन ठीक हो गई और चल रही है, बहुत बढ़िया, महोदय!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>बिलकुल भी बढ़िया नहीं है! मुझे ऊपर खींचों! अभी, तुरंत!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>केवल एक काम बचा है। इससे पहले कि हम आपको बाहर निकाल सकें, हमें केवल स्ट्रॉ रोप और पुल्ली तैयार करनी होगी।"],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>मुझे लगता है तुम मेरी खिंचाई कर रहे हो... *रोते हुए*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>चीफ, क्या आपको सामग्रियां मिल गई हैं? आप यह सब आराम से कर सकते हैं क्योंकि एंडा यहाँ नहीं है तो हम कुछ शांति का अनुभव कर सकते हैं..."],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>मैं तुम्हें अभी भी सुन सकती हूँ! यह ठीक नहीं है!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>मर गए! पता नहीं था कि वह सुन सकती है.... आह, पुल्ली तैयार है!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>प्रिय पुजारिन, बचाव दल नीचे आ गया है, कृपया सामने आएं ताकि आप पर पैर ना आ जाए……"],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>तुम पहले ही मेरे ऊपर खड़े हो! मेरे ऊपर से उतरो! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>ऐसा लगता है कि पुजारिन जल्द ही ऊपर आ जाएंगी, आपका बहुत-बहुत धन्यवाद, महोदया।"],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>मुझे महोदया ना कहें, मेरा नाम त्लचटगा है। अब, मुझे देखने दो, मैंने तुम्हें कहाँ घायल किया?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>पिंडली पर, महोदया, नहीं, त्लचटगा।"],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>ओह। मेरे जैसे शिकारी घाव भरने में पेशेवर हैं। मेरे पास खदान में सक्युलेंट पत्तों का एक थैला है। खदान को मैं भंडारण के रूप में इस्तेमाल करती थी। आइए उनमें से कुछ पत्ते उगाएं और उनके रस को आपके प्यारे छोटे पैर पर रगड़ें!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%>उह... छोटा पैर...ठीक है। तो क्या हमें अभी वहां नीचे जाना चाहिए? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"नहीं नहीं, नहीं, आप जैसे छोटे कमजोर दिल वालों को नीचे देखने के लिए मशालों की आवश्यकता होगी। यह आपके विचार से कहीं अधिक गहरी है। जाओ कुछ मशालें और उत्खनन उपकरण खोजो!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>इसे पकड़ो, अगर आग बुझ जाती है तो रुक जाना और वापस मुड़ना, ठीक है?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>क्या तैयार हो? चलो चलें! अपने कदम ध्यान से रखना!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>ठीक है महोदया!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"चीफ, यहां पुजारिन और मेरे साथ रुकने के लिए धन्यवाद। मैं बहुत दुखी हूँ कि मैं जा नहीं सका, लेकिन त्लचटगा ने कहा कि अगर मैं अपना पैर खोना नहीं चाहता तो बेहतर होगा कि मैं यहीं रहूं। मुझसे इंतजार नहीं हो रहा कि वे हमारे लिए क्या ला सकते हैं!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>मुझे विश्वास नहीं हो रहा है कि महान त्लाचटगा ने तुम्हें बस उसे नाम से बुलाने दिया। क्या सम्मान है! और तुम में ज़रा भी कृतज्ञता नहीं है..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>हे भगवान वह क्या है?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>यह एक भूमिगत नदी है! मुझे विश्वास नहीं हो रहा है कि हमारी टीम को एक <color=#f58c26>भूमिगत नदी</color>' मिल गई है! अब हमारे पास पानी है!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>और भीगे हुए।"],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>दिमाग से काम लो! यह बस थोड़ा सा पानी है! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"चीफ, अब आपके पास पानी है, हम कुछ सक्युलेंट उगा सकते हैं! एक सक्युलेंट पत्ता और कुछ जप और उचित देखभाल, आपको कुछ ही समय में एक मोटा सक्युलेंट मिल जाएगा!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>ये औरतें सब तुम्हारी हैं, जाओ और इन्हें कुछ बाल्टियाँ, फावड़े और खाद ढूँढ़ने दो। मैं यहीं इंतज़ार करूँगी।"],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>ठीक है! हो गया, देखो यह कितना प्यारा है! एक टुकड़ा लो, एक बड़ा।"],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>मैंने इस प्रकार का पौधा पहले कभी नहीं देखा……क्या? तुमने कहा एक टुकड़ा लो?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>हाँ, एक पत्ता लें, उसका रस निचोड़ें, अपनी जख्मी त्वचा पर मलें।"],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>ठीक है……एक टुकड़ा लो……रगड़ो……वाह, इसने वास्तव में काम किया! मैंने कभी किसी ऐसी जड़ी-बूटी के बारे में नहीं सुना जो घावों को इतनी जल्दी ठीक कर सके!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"लोग मुझे सारी धरती की माँ कहते हैं, बस ऐसे ही कहते हैं। मुझे लगता है कि यह नाम मेरे बेहद प्रभावशाली हरे अंगूठे से आया है। ये नियमित सक्युलेंट नहीं हैं। मैंने उन्हें उगाया है।"],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>चमत्कार! आह! अब मुझे लगता है कि हम कुछ ही समय में अपने घर के रहस्य को सुलझा सकते हैं! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"दरअसल, इसके बारे में, मुझे वास्तव में अब एक झपकी की ज़रूरत है क्योंकि मेरी ऊर्जा समाप्त हो गई है। क्या तुम्हे बुरा लगेगा अगर मैं तुम्हारे उस "घर" में सो जाऊं? क्या यह बेस कैंप है? क्या आपके पास बिस्तर है?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"हाँ, यह एक तरह के बेस कैंप ही है, और यहाँ वह नक्शा है जिसे हमने वापस जाने के लिए बनाया है। लेकिन……क्या आप सिर्फ सोने की योजना बना रही हैं या आप हमारे साथ आ रही हैं?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>बेशक तुम्हारे साथ आ रही हूँ! क्या तुम बेवकूफ हो?! तुम्हे मदद चाहिए, मैं कुछ नहीं कर रही, क्यों नहीं? हम शायद वैसे भी एक ही व्यक्ति के पीछे हैं। इसलिए! मैं वह नक्शा लूंगी, फिर मिलेंगे!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"और वह चली जाती है। मुझे लगता है कि वह हमारे लोगों के लिए बहुत अच्छी दोस्त साबित होगी। आइए अपने कैंप का निर्माण समाप्त करें। हमारे पहले वाले कैंप की तरह, हमें सामग्रियों को स्टोर करने के लिए एक <color=#f58c26>गोदाम</color> की आवश्यकता है।"],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>आइए <color=#f58c26>गोदाम</color> के लिए कुछ सामग्रियां इकट्ठी करें!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>बहुत बढ़िया! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>तुमने मुझे अभी तक पानी की ओर ले जाने के लिए धन्यवाद नहीं दिया है! मैंने आपको बताया कि मैं इस जगह के बारे में सही थी!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>ठीक है ठीक है। मैं भविष्य में आपकी दैववाणी का पूरा सम्मान करूंगा और आपके हर एक अनुचित अनुरोध को पूरा करूंगा। अब आपको क्या चाहिए?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>तुम…! कोई बात नहीं। हमें आगे कहाँ जाना चाहिए, यह जानने के लिए मुझे फिर से परमेश्वर से बात करनी होगी। इस बार मुझे ज्योतिष को आजमाने के लिए एक <color=#f58c26>वॉचटावर</color> की जरूरत है। "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>ज्योतिष क्यों? हमें अभी यह भी नहीं पता है कि वे सितारे क्या हैं, मेरा मतलब है, वे सिर्फ आसमान पर चमकते धब्बे हैं!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>हमारे पास समय नहीं बचा है! हमारे पास करने के लिए बहुत सारे काम हैं! अपनी बेवकूफी भरी बाते बंद करो!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>जाओ और जरूरत का सामान इकट्ठा करो और जल्द से जल्द वापस आना!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>ठीक है फिर..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>बड़ों ने मुझसे कहा कि बुजुर्गों के साथ मत उलझो, मैंने कभी क्यों नहीं सुना……"],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%>ठीक है चीफ, आपने अपना काम पूरे कर लिया है और केवल एक चीज बाकी है <color=#f58c26>वाचटावर</color> जिसे पुजारिन ने मुझे बनाने के लिए कहा है..."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>बदमाश मैं तुम्हे सुन सकती हूँ! शिकायत करना बंद करो और अपना काम करो!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>ठीक है~ठीक है~*गहरी सांस*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>ठीक है चीफ, मैं देवताओं से बात करने जा रहा हूँ।"],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>तुम कुछ देर आराम कर सकते हो, थोड़ी देर में मिलती हूँ।"],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*फुसफुसाहट* यहाँ, चीफ, यहाँ...."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>एंडा अंत में एक पल के लिए रुक सकती है।"],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>हमारी टीम को खदान में नीचे सोने और कच्चे अयस्कों का ढेर मिला।"],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>हम उन्हें ले जाने के लिए एक संदूक बनाने की सोच रहे हैं, इसलिए हम आपकी मदद मांग रहे हैं।"],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>क्या आप संदूक को बनाने के लिए कुछ सामग्री एकत्र करेंगे?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>ओह, यह बहुत सारा सोना है। "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>यह क्या है? यह चमक रहा है..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>यह एक छोटा पैकेज है...इस पर लिखा है "मुझे खाओ"। और इसके अंदर एक <color=#f58c26>चमकता हुआ बीज है</color>? इसका क्या मतलब है, बीज को खाओ?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>इसे मुझ पर छोड़ दो!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%>क्या?! पुजारिन, आप क्या कर रही हैं?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>क्या आपने इसे खा लिया? हमने अभी पता भी नहीं लगाया कि यह क्या है!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"तारों का पैटर्न <color=#f58c26>दक्षिणपूर्व</color> की ओर <color=#f58c26>ग्रेट कैन्यन</color> की ओर इशारा कर रहे हैं, और <color=#f58c26>शामक बीज</color> मुझे महान से मिलने में मदद करेगा...*खर्राटे*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%>क्या हुआ पुजारिन? क्या हुआ? क्या आप अभी भी होश में हैं?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*खर्राटे*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>और वह सो जाती है। मुझे रहस्यमय शक्तियों वाले लोग बिल्कुल समझ नहीं आते। वे कई बार इतने अजीब लगते हैं। "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%>उर्र, हमें अब आगे कहाँ जाना चाहिए क्योंकि अब पुजारिन बेहोश हो चुकी है?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%>उन्होंने कहा था <color=#f58c26>ग्रेट कैन्यन</color> यही कहा था ना? <color=#f58c26>दक्षिणपूर्व</color> की ओर?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>क्या हमें उन पर भरोसा करना चाहिए? वह फिलहाल अपने आपे में नहीं लग रही है?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"हाँ, मैंने वादा किया था कि मैं भविष्य में उस पर भरोसा करूंगा। इसके अलावा, हम वैसे भी आगे कहाँ जा सकते हैं? चलो आज आराम करते हैं, और कल दक्षिणपूर्व की ओर चलेंगे।"],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%>अरे तुम!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"क्या मैं?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"हाँ! तुम। क्या तुम बूढ़ी औरत की मदद करोगे?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"अरे... मैं वास्तव में यहाँ से नहीं हूँ।"],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"हुह, और ऐसा कैसे?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"मैं यहाँ अपनी जनजाति के लोगों के साथ आया हूँ। हम ऐसे नायकों की तलाश में हैं जो हमारे घर के रहस्य को सुलझाने में हमारी मदद कर सकें।"],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"अच्छा, मैं समझ गई। मैं वास्तव में तुम्हारे हाथ में मौजूद उस छोटे से चमकते हुए टुकड़े के माध्यम से तुम्हारी आत्मा से बात कर रही हूँ?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"मेरा....<color=#f58c26>फ़ोन</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"हाँ बिल्कुल। <color=#f58c26>"तुम्हारा फोन"</color>। क्या तुम मेरी मदद करोगे?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"रुको... क्या आप मुझे *महसूस* कर सकती हैं?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"ओह स्वीटी हालांकि मेरी एक आंख है, फिर भी मैं सब कुछ महसूस कर सकती हूँ। तुम बाद में समझ जाओगे। अब, क्या तुम मेरी मदद करोगे?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"ठीक है, आपको क्या चाहिए?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"तुम्हारी जनजाति दायीं ओर से गुजरने वाली है? मैं दिखावा करूंगी कि मुझे भोजन की सख्त जरूरत है और अपना कचरा बेचने के लिए एक <color=#f58c26>छोटा बूथ</color> तैयार करवाना है? हे भगवन, अद्भुत योजना!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"मुझे समझ नहीं आया..."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"मैं कुछ असभ्य लोगों की मदद नहीं करना चाहती, ठीक है? मेरी मदद पाने के लिए तुम्हे अच्छे से व्यवहार करना होगा।"],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"तो?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"अगर वे मेरा सामान खरीदते हैं और मुझे खाना देते हैं, तो वे ठीक है। या मुझे सीधे खाना देते हैं, और भी अच्छा है!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"अन्यथा? एक चुटकी और आपकी जनजाति नहीं रहेगी। समझ गए? तो जाओ मेरे लिए कुछ सामग्री इकट्ठा करो!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"अद्भुत! आपका बहुत-बहुत धन्यवाद! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"मुझे आशा है कि मेरी बेटी तुम्हारी तरह विश्वसनीय और कुशल है। "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"हम पहले रेगिस्तान में अलग हो गए, और मैं खो गई...मेरी दिशा की समझ उतनी अच्छी नहीं है। "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"क्या आपको पता है वह अब कहाँ है?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"बेशक मुझे पता है कि वह कहाँ है! लेकिन वह...मेरी तलाश नहीं कर सकती! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"यह अच्छा लगता है। क्या तुम्हें पता है? बस तुम और मैं, ठिठुरते हुए, थोड़ी बातचीत करते हुए और कुछ चाय..."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"वे आ रहे हैं। हमें बस इंतजार करना है।"],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"एक लंबा समय बीत चुका है।"],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"मैं उन हड्डियों पर चढ़ने जा रही हूँ और देखूंगी कि वे कहाँ हैं।"],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"हा! वे पूरी तरह से वहाँ हैं! तुम्हारी वह छोटा पुजारिन बहुत प्यारी है!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"ठीक है, वे कुछ ही समय में यहाँ होंगे। मैं तुम्हारे लोगों से मिलने का इंतजार नहीं कर सकती! मुझे सावधानीपूर्वक नीचे आना होगा……"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"क्या आप ठीक हैं?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"हेलो?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"एक क्षण बाद"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>""भूख से मर रही हूँ, कृपया चीजें खरीदें, कृपया खाना दें।" हुह। लगता है यहां किसी ने कोई छोटा सा धंधा शुरू कर दिया है।"],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"चीफ, आप यहाँ। पुजारिन एंडा ने कहा कि उनके सपने में किसी ने बताया कि कोई यहाँ हमारा इंतजार कर रहा है। "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"मुझे यहाँ मानव गतिविधि के कुछ निशान दिखाई दे रहे हैं, लेकिन यह कैंपफायर बुझ गई, यह छोटा बूथ टूटने वाला है, और मुझे आसपास कोई नहीं दिखाई दे रहा है...हम खड़े हो गए?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"खैर, चलो एक कैंप बनाते हैं और यहाँ रात बिताते हैं, और उस "सपने वाले व्यक्ति" के आने का इंतज़ार करते हैं।"],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"मैं बहुत ज्यादा थक गई हूँ…आखिरकार…यह पोशाक एक ओवन के जैसी है! मैं भुन रही हूँ! इसे उतार दो!!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"प्रिय पुजारिन, आप ऊंट की पीठ पर बहुत गहरी नींद सो रही थी। आप "बहुत ज्यादा थक गई" ऐसा नहीं कह सकती।"],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"वैसे, आप अपनी पोशाक भी नहीं उतार सकती। भले ही यह अभी पाताल की तरह गर्म है, लेकिन रात में बहुत ठंड होगी।"],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"प्रिय भगवान...आपने मुझे इस उजाड़ जगह पर आने के लिए क्यों कहा...और मुझे इस घमंडी इन्सान को भी सहना पड़ता है..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"कृपया थोड़ा और धैर्य रखें। चीफ यहां <color=#f58c26>टेंट</color> बनाने के लिए जरूरी सामग्री इकट्ठा करेंगे।"],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"बहुत अच्छे चीफ! आओ शुरू करें!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"बहुत बढ़िया! मेरा मानना है कि लोग अब तक भूखे हैं। आइए इस कैंपफायर का पूरा इस्तेमाल करें और कुछ पकाएं। अच्छा खाओ अच्छा काम करो!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"हूरे! खाना! बेकन!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"कृपया मेरे लिए मेम्ने चॉप करें..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"तुम जंगली मांसाहारी!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"तो आप क्या चाहती हैं?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"स्टेक, मध्यम हॉर्सरैडिश सॉस के साथ।"],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"पुजारिन, वह भी है..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"मुझे पता है! चुप रहो!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"हाहा, यात्रा करने वाले शरीर के लिए प्रोटीन बहुत महत्वपूर्ण है। यह एक कठिन सवारी रही है, तो चलिए दावत करते हैं! आप क्या कहते हैं, चीफ?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"हमारे पास खाना बनाने के लिए इतनी सामग्री नहीं है..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"हमारे पास मटन, सूखे बीफ और सेब हैं, चीफ!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"लेकिन चीफ सही कह रहे हैं, हम अभी भी उनमें से कुछ को आने वाली कठिन रातों के लिए बचाना चाहते हैं। इसलिए हमें कुछ वैकल्पिक प्रोटीन खोजने की जरूरत है।"],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"मैंने कुछ रेगिस्तानी छिपकलियों को देखा था। छिपकली के अंडे प्रोटीन का बेहतरीन स्रोत होते हैं!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"तुमने क्या कहा? छिपकलियां?! हम छिपकलियां कैसे खा सकते हैं?! "],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"अगर हम अपनी सोच बदलें तो हम हर तरह की स्वादिष्टता बना सकते हैं! उदाहरण के लिए, "छिपकली स्टू" विशेष रूप से आकर्षक लगता है!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"मैं इंतजार नहीं कर सकता!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"ओह...छिपकली का शिकार....."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"अद्भुत! तुमने सारी सामग्री इकट्ठी कर ली है! चलो आगे बढ़ें!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"आ रहा हूँ! कैंपफायर जलाओ!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"अंत में...खाना...मैं और नहीं हिल सकता...एक तरफ से पका हुआ...स्टेक...बेक्ड सेब..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"अरलान के लिए मटन चॉप, केविन के लिए सनी-साइड अप...और पुजारिन एंडा मेरे साथ यह स्वादिष्ट छिपकली स्टू साझा करेंगी..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"कोई भी छिपकली स्टू साझा नहीं कर रहा है!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"फिर, मैं अपने नए दोस्तों को गरमा गरम, स्वादिष्ट स्टू का यह कटोरा दूंगा।"],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"नए दोस्त? कौन हैं नए दोस्त?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"आह!!! नहीं!!! इन चूहों को मेरे ऊपर से हटाओ!!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"इन्हें चूहे कहना तो ठीक नहीं होगा। मेरे विचार से, ये मौबिट्स हैं, एक प्रकार के रोडेंट जो शुष्क क्षेत्रों में पाए जाते हैं।"],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"वे आकार में आश्चर्यजनक रूप से बड़े होते हैं लेकिन वे आमतौर पर डरपोक होते हैं, जिससे वे मनुष्यों को हानि नहीं पहुंचाते।"],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"ठीक है, ठीक है मुझे पता है!!! वे क्या हैं मुझे इस बात की कोई परवाह नहीं है! उन्हें मेरे ऊपर से हटाओ!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"अब जब आपने इस बात का जिक्र कर दिया है, तो यह काफी अजीब है कि वे आपसे बिल्कुल भी नहीं डरते……"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"प्रिय श्रमिको, क्या आप अपनी दयालुता दिखाते हुए इन प्यारे जीवों को हमारी पुजारिन से हटा देंगे?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"हाँ!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"सुनो! इसे मुझे वापस करो!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"हम्म, और वे चले जाते हैं। ऐसा लगता है कि वे अभी भी पुजारिन को छोड़कर सभी से डरते हैं।"],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"वे मेरी अंगूठी ले गए! मेरी प्यारी अंगूठी..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"बेचारी पुजारिन, मुझे लगता है कि हम ड्रैगन के अवशेषों में उनके कदमों का अनुसरण कर सकते हैं? मैं वैसे भी उन छोटे जीवों के बारे में काफी उत्सुक हूँ। "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"और ऐसा करने के लिए, यह ध्यान में रखते हुए कि पहाड़ की ढलान कितनी कड़ी है हमें लोगों को ऊपर और नीचे ले जाने में मदद करने के लिए एक <color=#f58c26>पवनचक्की</color> चाहिए।"],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"क्या हम सब पहले से ही <color=#f58c26>पवनचक्की</color> की सामग्री के साथ तैयार हैं?! जबरदस्त!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"नई पवनचक्की आ रही है!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"मस्त! अब ढलान पर ऊपर और नीचे जाना सुरक्षित और आसान होगा!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"बहुत बढ़िया! जलती करो और मेरी अंगूठी वापस लाओ! वह बहुत पवित्र है!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"ठीक है, हम जा रहे हैं! केविन, अरलान, क्या तुम तैयार हो?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"हमेशा की तरह!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"श्रीमान...मैं डरपोक नहीं हूँ, लेकिन मुझे लगता है कि हमें अभी भी रस्सियाँ चाहिए अगर हम चट्टान से गिर जाते हैं तो... "],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"आहा, तुम बिलकुल ठीक कह रहे हो! काम में सुरक्षा बहुत महत्वपूर्ण है! तो चीफ, कुछ सुरक्षा उपकरण लाएं!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"क्या हम अब तैयार हैं?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"हाँ!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"अति सुंदर! चलो अभी चलते हैं और मौबिट्स के रहस्य को सुलझाते हैं! कितना रोमांचक है!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"और मेरी अंगूठी वापस लाना!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"वाह, यह वास्तव में हड्डी का गहरी ढेर है! रुको...नीचे एक चमचमाती चीज़ है...हम्म...क्या यह एंडा की अंगूठी हो सकती है?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"चीफ! देखें हमें क्या मिला! धूल में लिपटी हुई एक बूढ़ी औरत!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"और पुजारिन की अंगूठी"],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*आंख में आंसू* धन्यवाद, अरलान, हम सब में सबसे समझदार……रुको……क्या?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*रोमांचक आवाजें*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"मुझे लगता है....धन्यवाद?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*आनंदमय आवाजें*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*रोमांचक आवाजें*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"ओह हाय! हैलो! आप बहुत दोस्ताना लग रहे हैं! क्या मैं आपको जानती हूँ? आपका फर जाना पहचाना लगता है..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"ओह! और आप मेरे सपने की वह छोटी पुजारिन होनी चाहिए! आप असल जिंदगी में भी बहुत प्यारी हैं!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"क्या छोटी? तुम्हारी हिम्मत कैसे हुई मुझे छोटा कहने की? मैं ईश्वर की महान दूत हूँ..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"क्षमा करें, क्या अपने कहाँ कि हमारी पुजारिन आपके सपने में आई थी?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"ओह~युवा पुरुष! हाँ! मैंने आपकी छोटी पुजारिन को सपने में यह कहते हुए सुना: "मैं तुम्हारा इंतजार करूंगी।" लेकिन मुझे नहीं पता कि इसका क्या मतलब है!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"इस बात का क्या मतलब है कि तुम नहीं जानती कि इसका क्या मतलब है?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"दरअसल, यह मजेदार है। मुझे अपना नाम बिल्कुल याद नहीं है, इसलिए मुझे नहीं पता कि उस अजीब सपने का क्या मतलब है। "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"जब मैं गड्ढे में गिर गई थी तब मेरा सिर किसी चीज से बहुत जोर से टकराया होगा। चलते हुए भी मैं थोड़ा लड़खड़ाती हूँ। "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"क्या यह छोटा बूथ आपका है? इस पर लिखा है "भूख से मर रही हूँ, कृपया चीजें खरीदें, कृपया खाना दें?""],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"यह देखते हुए कि इस बूथ पर जो लिखा है वह मेरा सटीक वर्णन करता है, और यह कि हम एक रेगिस्तान के बीच में हैं, हाँ, मुझे लगता है कि यह मेरा है।"],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"ओह! चिंता न करें! हमारे पास खाना है। कृपया हमारे तंबू में खाने का आनंद लें।"],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"यह अद्भुत होगा!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"ओह, एक बात हालांकि, मुझे हवा में बेकन, पके हुए सेब की गंध और....<color=#f58c26>एक आने वाले तूफान</color> का अहसास हो रहा है। बेहतर होगा कि आप तैयार रहें। "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"और....वह चली जाती है। ठीक है, चीफ, मुझे यकीन है कि आपने सुना, यहाँ हवा बहुत तेज है, मुझे देखने दो..."],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"हमें अपने तम्बू को मजबूत करने की जरूरत है।"],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"हमें उसकी बात क्यों सुननी है! हम नहीं जानते कि वह कहाँ से आई है, और तुम उसकी बातों का विश्वास कर रहे हो! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"मेरी भविष्यवाणियाँ.....तुम हमेशा गलत चुनते हैं और बार-बार मेरा मज़ाक उड़ाते हो! मैं उस महिला के असली रंग को उजागर करने वाली हूँ, तुम बस इंतजार करो और देखो!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"ओह, कोई मुकाबले की तयारी कर रहा है। वैसे भी, चीफ, मैंने <color=#f58c26>तम्बू को मजबूत करने</color> के लिए आवश्यक सामग्रियों की सूची बनाई है, कृपया एक नज़र डालें।"],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"हम्म, शानदार चाय।"],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"और यह बिस्किट भी काफी अच्छा है, मुंह में पिघल रहा है। हालांकि यह बाहर से थोड़ा जला हुआ है। "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"आप अगली बार तापमान कम रख सकते हैं और इसे अधिक समय तक बेक कर सकते हैं।"],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"वह दोपहर की चाय क्यों पी रही है?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"क्या बात है?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"और उसका अजीब ब्रिटिश उच्चारण! हम सही युग में भी नहीं हैं!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"शांत हो जाओ, छोटी पुजारिन। सब कुछ ठीक हो जाएगा। तुम समझ जाओगी।"],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"नहीं न! कुछ भी ठीक नहीं होगा! और मुझे कुछ समझ नहीं आ रहा है! प्रिय भगवान...यह महिला कहां से आई है...."],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"चूंकि आपने पूरी ईमानदारी से पूछा है, वास्तव में, दोपहर की चाय के लिए धन्यवाद, जिसका मैंने अभी-अभी बहुत आनंद लिया..."],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"मुझे लगता है कि मुझे कुछ बातें याद आ गई हैं। दरअसल, मेरा मतलब है, ईमानदारी से बोलना, निष्पक्ष रूप से बोलना, सच्चाई यह है……"],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"क्या तुम बता नहीं सकती?"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"क्या तुम मेरे लिए भी बाहर उस <color=#f58c26>छोटे बूथ</color> को मजबूत बना सकती हो?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"क्या?"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"मैं दुबली बुढ़िया जो कई दिनों से अकेले चल रही है, भूखों मरते हुए इस बूथ को बना रही है……ओह, बेचारी औरत!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"अगर बूथ टूट जाता है तो यह मेरे लिए बहुत हानिकारक साबित होगा। मेरी किस्मत तुम पर निर्भर है! मैं आपकी बहुत आभारी रहूंगी!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"कितनी दिलचस्प महिला है।"],
