13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"वैसे कहानियों के मुताबिक मेरी माँ में बहुत सी बातें हो सकती हैं। जब मैं छोटी थी तब उन्होंने अपनी असली पहचान लोगों से छुपाई थी।"],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"क्योंकि आप जानते हैं, एक अंधी औरत और तीन साल की बच्ची, जिनका फायदा उठाए जाने की पूरी सम्भावना थी?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"मुझे लगता है कि इस तरह कहानी फैलनी शुरू हुई... एक सर्वशक्तिमान ड्र्यूड जो यह सब जानता है, एक अंधा योद्धा, एक शक्तिशाली शूरवीर..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"जबकि वास्तव में वह अजीब हास्य की समझ वाली एक अंधी बूढ़ी औरत है।"],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"मग रुइथ एक महिला है... और मैं मग रुइथ के प्रति कठोर थी...ओह...मैं बर्बाद हो जाऊंगी...मैं पुजारिन की उपाधि के लिए एक कलंक हूँ..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"छोटे पुजारिन, इतनी उदास मत हो। अच्छा व्यवहार करने से तुम्हे बेहतर लगेगा~ मैं तुम्हे इस बार माफ कर दूंगी क्योंकि तुम बहुत प्यारी हो!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"तो क्या अपने हमें मूर्ख बनाया? क्या आपकी याददाश्त गुम नहीं हुई थी?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"हाँ...इसके लिए क्षमा करें। लंबी यात्राएं उबाऊ हो सकती हैं, आप जानते हैं? बस कुछ मज़े ले रही हूँ~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"लेकिन सुनो, उस खूबसूरत तम्बू और उस खूबसूरत बूथ को देखो! अब यह एक कैंप की तरह दिखने लगा है! फिर भी इसमें कमी महसूस होती है......"],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"क्या कमी लग रही है?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"मुझे देखने दो…"],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"एक द्वार! कैंप में प्रवेश के लिए आपको एक द्वार की आवश्यकता है, और कुछ रोशनी के साथ, यह हमेशा की तरह शानदार दिखाई देगा!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"हम आपके सबसे विनम्र सेवक होंगे और उस द्वार का निर्माण करेंगे, महोदया! चीफ, तैयार हो जाएं!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"क्या सबकुछ मिल गया? बहुत बढ़िया! चलते जाओ चलते जाओ!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"ओह! कितना नया लग रहा है! यह पहली निर्माण परियोजना है जिसे मैंने निर्देशित किया है...."],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"बधाई हो पुजारिन, आप बहुत बड़ी हो गई हैं। लेकिन पता नहीं क्या मेग अब इस बात से संतुष्ट हैं कि हमारा कैंप कैसा दिखाई देता है?"],
